import { Icon } from "antd";
import { LogoWrapper } from "./styles";
import Link from "next/link";
const Logo = () => (
	<LogoWrapper>
		<Link href="/">
			<div>Logo</div>
		</Link>
	</LogoWrapper>
);
export default Logo;
